import React from "react";
import ReactDom from "react-dom";

// import Main from "./Main";

import { BrowserRouter } from "react-router-dom";

import axios from "axios";

const App = () => {
  return <div id="app"></div>;
};

ReactDom.render(
  <BrowserRouter>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </BrowserRouter>,
  document.getElementById("app")
);
